import { Row, Col } from "react-bootstrap";

// Import components
import LeftRegister from "../components/LeftRegister";
import RightRegister from "../components/RightRegister";
import "../css/Register.css";

const Register = () => {
  return (
    <>
      <Row>
        <Col md={12} sm={12}>
          <LeftRegister />
        </Col>
        <Col md={12} sm={12}>
          <RightRegister />
        </Col>
      </Row>
    </>
  );
};
export default Register;
